INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('E-100', 'Wojsko lądowe', 300, 'Niemiecki prototypowy  czołg superciężki opracowany w końcowej fazie II wojny światowej. Pojazd zaprojektowano w ramach programu Entwicklungsserie, mającego na celu opracowanie serii pojazdów pancernych różnych typów, możliwie uproszczonych i zestandaryzowanych.' , 'E-100.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Maus', 'Wojsko lądowe', 400, 'Prototypowy czołg superciężki onstrukcji niemieckiej z okresu II wojny światowej. Z łączną masą sięgającą 188 ton był to najcięższy i największy czołg, jaki kiedykolwiek skonstruowano, lecz nigdy nie wszedł do produkcji seryjnej, ani nie został użyty bojowo; powstały jedynie dwa nieukończone prototypy' , 'Maus.jpg', GETUTCDATE());  
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Messerchmitt Me262A', 'Lotnictwo', 200, 'Pierwszy użyty bojowo samolot myśliwski o napędzie odrzutowym produkowany seryjnie podczas II wojny światowej przez Niemcy[1]. Wszedł do służby w 1944 jako samolot bombowy (A-2a) i rozpoznawczy (A-1a/U3 oraz A-4a), a także jako myśliwiec przechwytujący (A-1a) i nocny (B-1a/U1).' , 'Messerschmitt_Me_262A_.jpg', GETUTCDATE()); 
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Schwerer Gustav', 'Artyleria', 1000, 'Niemieckie działo kolejowe kalibru 802 mm, największe i najbardziej kosztowne działo w historii.' , 'Gustav.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Rakieta V-1', 'Pocisk', 200, 'Niemiecki samolot-pocisk (pocisk manewrujący) z okresu II wojny światowej. Potocznie nazywany latającą bombą.' , 'V-1.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Bismarck', 'Marynarka Wojenna', 800, 'Niemiecki pancernik klasy Bismarck z okresu II wojny światowej, bliźniaczy okręt „Tirpitza”. Oba te pancerniki były największymi jednostkami Kriegsmarine w historii i największymi europejskimi okrętami bojowymi.' , 'Bismarck.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Landkreuzer P.1000 Ratte', 'Czołg', 2000, 'Projekt czołgu superciężkiego, przeznaczonego dla sił zbrojnych III Rzeszy. Landkreuzer znaczy lądowy krążownik, a ratte to szczur.' , 'Landkreuzer P. 1000 Ratte.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Lowe', 'Wojsko lądowe', 400, 'Projekt czołgu superciężkiego stworzonego przez firmę Krupp na potrzeby Wehrmachtu.' , 'Lowe.jpg', GETUTCDATE()); 
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Me 323 Gigant', 'Lotnictwo', 300, 'Niemiecki wojskowy samolot transportowy zaprojektowany i budowany od 1942 w wytwórni Messerschmitt A.G. w zakładach w Leipheim i Obertraubling.' , 'Me 323 Gigant.jpg', GETUTCDATE()); 
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Kugelblitz', 'Wojsko lądowe', 300, 'Prototypowe niemieckie samobieżne działo przeciwlotnicze testowane pod koniec II wojny światowej.' , 'Kugelblitz.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Horten Ho 229', 'Lotnictwo', 500, 'Stalowo-drewniany szturmowy/bombowy samolot niemiecki typu latające skrzydło wyprodukowany w styczniu 1945 przez Gothaer Waggonfabrik AG.' , 'Horten_Ho_229.jpg', GETUTCDATE());
INSERT INTO Products (Name, Category, Price, Description, ImageFileName, CreatedAt) VALUES ('Graf Zeppelin', 'Marynarka', 600, 'Nieukończony lotniskowiec III Rzeszy z okresu II wojny światowej. Jedyny lotniskowiec w historii Niemiec.' , 'Graf-Zeppelin.jpg', GETUTCDATE());